// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

// NFT contract to inherit from.
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import 'base64-sol/base64.sol';

interface INFTReward {
    function mintNFT(string memory _title, string memory _description, string memory _imageURI) external;
    function getNFTs(address _owner) external view returns (uint[] memory); 
}

contract NFTReward is ERC721URIStorage, INFTReward {

    struct NFTFund {
        string title;
        string description;
        uint amountDonated;
        string imageURI;
    }

    // NFTs tokenId => that NFTs attributes.
    mapping(uint256 => NFTFund) public nftAttributes;

    uint public tokenCounter;

    address private _owner;

    // track each users NFTs
    mapping(address => uint[]) public userNFTs;

    constructor() ERC721("NFTReward", "REW") {
        tokenCounter = 0;
        _owner = msg.sender;
    }

    // NFT functions

    function mintNFT(string memory _title, string memory _description, string memory _imageURI) external {
        uint newItemId = tokenCounter;
		_safeMint(msg.sender, newItemId);
        
        nftAttributes[newItemId].title = _title;
        nftAttributes[newItemId].description = _description;
        nftAttributes[newItemId].imageURI = _imageURI;

        userNFTs[msg.sender].push(newItemId);

        tokenCounter++;
    }

    // returns the tokenURI for the given tokenId

    function tokenURI(uint _tokenId) public view override returns (string memory) {
        NFTFund memory fund = nftAttributes[_tokenId];

        string memory json = Base64.encode(
            bytes(
                string(
                    abi.encodePacked(
                        '{"title": "',
                        fund.title,
                        ' -- NFT #: ',
                        Strings.toString(_tokenId),
                        '", "description": "',
                        fund.description,
                        '", "imageURI": "',
                        "ipfs://", fund.imageURI, '"}'
                    )
                )
            )
        );

        string memory uri = string(
            abi.encodePacked("data:application/json;base64,", json)
        );

        return uri;
    }

    // Get all NFTs owned by a user
    function getNFTs(address owner) public view returns (uint[] memory) {
        return userNFTs[owner];
    }
}
